import React from "react";
import {Routes, Route, BrowserRouter as Router} from "react-router-dom";

import Navbar from "./components/navbar"
import Timeline from "./components/timeline"
import Welcome from "./components/welcome"
import Projects from "./components/projects"
import Interests from "./components/interests"
import Competences from "./components/competences"
import Knowledge from "./components/knowledge"

import "./public/styles/style.css";
import logo1 from './public/images/FarmtoFork.png';
import logo2 from './public/images/icon.png';
import TimelinePage from "./components/timelinePage";
import ProjectsPage from "./components/projectsPage";
import InterestsPage from "./components/interestsPage";
import CompetencesPage from "./components/competencesPage";

function App() {
  return (
      <div className="app">
          <Router>
          <Navbar />
            <Routes>
            <Route path='/' component={<TimelinePage/>}/>
              <Route path='/timeline' component={<TimelinePage/>}/>
              <Route path='/projects' component={<ProjectsPage/>}/>
              <Route path='/interests' component={<InterestsPage/>}/>
              <Route path='/competences' component={<CompetencesPage/>}/>
            </Routes>
          </Router>
      </div>

  );
}

export default App;
